function toClipBoard() { const text = this; navigator.clipboard.writeText(text).then( () => { // コピーに成功したときの処理 console.log('Copy success!' + ',' + text) }, () => { // コピーに失敗したときの処理 console.log('Copy fail!') }); }
for (var cnt=1; cnt <= 25; cnt++ ) { const node=document.getElementById("n-"+cnt); node.addEventListener("click", toClipBoard.bind(nodeText[cnt])); }
